import React, { useState } from 'react';
import { Container, Typography, Box, TextField, IconButton, Divider, Grid } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import SearchResult from './components/SearchResult';
import NoResult from './components/NoResult';

const theme = createTheme({
  palette: {
    primary: {
      main: '#E1261C',
    },
  },
});

function App() {
  const [query, setQuery] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleSearch = async () => {
    setIsLoading(true);
    setError(null);
    try {
      const response = await fetch('http://localhost:8000/search', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ question: query }),
      });
      if (!response.ok) {
        throw new Error('Search request failed');
      }
      const data = await response.json();
      setSearchResult(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <Container maxWidth="lg">
        <Box sx={{ my: 4 }}>
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
            <SearchIcon color="primary" sx={{ mr: 1 }} />
            <Typography variant="h5" component="h1" sx={{ fontWeight: 'bold' }}>
              {query || ""}
            </Typography>
          </Box>
          <Divider sx={{ borderColor: 'primary.main', borderWidth: 2 }} />
          <Box sx={{ mt: 2, mb: 4 }}>
            <TextField
              fullWidth
              variant="outlined"
              placeholder="질문을 입력하세요"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              onKeyPress={(e) => {
                if (e.key === 'Enter') {
                  handleSearch();
                }
              }}
              InputProps={{
                endAdornment: (
                  <IconButton onClick={handleSearch} edge="end" color="primary">
                    <SearchIcon />
                  </IconButton>
                ),
              }}
            />
          </Box>
          {isLoading && <Typography align="center">Loading...</Typography>}
          {error && <Typography color="error" align="center">{error}</Typography>}
          <Grid container spacing={2}>
            <Grid item xs={8}>
              {searchResult && searchResult.sources && searchResult.sources.length > 0 ? (
                <SearchResult result={searchResult} />
              ) : (
                !isLoading && !error && <NoResult />
              )}
            </Grid>
            <Grid item xs={4}>
              {searchResult && searchResult.sources && searchResult.sources.length > 0 && (
                <Box sx={{ mt: 2 }}>
                  <Typography variant="h6" gutterBottom>논문 리스트</Typography>
                  <Divider sx={{ mb: 2 }} />
                  {searchResult.sources.map((source, index) => (
                    <Box key={index} sx={{ mb: 2 }}>
                      <Typography variant="subtitle1" color="primary">
                        {index + 1}. {source.title}
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        저자: {source.authors}
                      </Typography>
                      {source.url && (
                        <Typography variant="body2">
                          <a href={source.url} target="_blank" rel="noopener noreferrer">
                            논문 보기
                          </a>
                        </Typography>
                      )}
                    </Box>
                  ))}
                </Box>
              )}
            </Grid>
          </Grid>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
